import React, { Component } from 'react';
import PopularMovies from './PopularMovies';
import LatestMovies from './LatestMovies';
import axios from 'axios';

class Home extends Component {
  state ={
    popularMovies: [],
    latestMovies: [],
  }

  componentDidMount(){
    axios.get('https://yts.mx/api/v2/list_movies.json?minimun_rating=9')
      .then(res =>{
        this.setState({
          ...this.state,
          popularMovies: res.data.data.movies.slice(0,4)
        })
      })
  }
  render() {
    
    console.log(this.state);
    return (
      <div>
        <div className="hero-section background-img">
        {/* <div className="background-img"></div> */}
          <div className="container">
            <div className='hero-title'>
              <h1>Download YTS YIFY movies: HD smallest size</h1>
              <p>Welcome to the official YTS.MX (.LT) website. Here you can browse and download YIFY movies in excellent 720p, 1080p, 2160p 4K and 3D quality, all at the smallest file size. YTS Movies Torrents.</p>
            </div>
            <PopularMovies />
          </div>
        </div>
        <LatestMovies />
      </div>
    )
  }
}

export default Home
